import React from 'react';

export default function Card({ name,lastname, fullname,title, family, image,imageUrl}) {
  return (
    <div>
        <h3>{name}</h3>
        <h3>{lastname}</h3>
        <h3>{fullname}</h3>
        <h3>{title}</h3>
        <h3>{family}</h3>
        <img src= {image}  alt="img not found"/>
        <img src= {imageUrl}  alt="img not found"/>
    </div>
  );
}
